import React from 'react'
import ArtCard from ''

function ArtList({ art }) {

    // console.log(art)

    const renderArtList = art.map(artpiece => {
        <ArtCard key={artpiece.id} artpiece={artpiece}/>
    })

    return (
        <ul className="cards">{renderArtList}</ul>
    )
}

export default ArtList
